import React from "react";
import Home from "./pages/Home";
import Error from "./pages/Error";
import useGlobalReducer from "./hooks/useGlobalReduceer";

function App() {
  const [state, _] = useGlobalReducer();

  return (
    <div className="App">
      {state.get("error") ? <Error /> : null}
      {state.get("id") ? <Home /> : <Login />}
    </div>
  );
}

export default App;
